import React, { useState } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { useNavigate } from 'react-router-dom';
import { Modal, Button } from 'react-bootstrap';

export default function MenuBar() {
    const navigate = useNavigate();
    const [show, setShow] = useState(false);
    const [modalContent, setModalContent] = useState({ title: '', action: '' });

    const handleClose = () => setShow(false);
    const handleShow = (title, action) => {
        setModalContent({ title, action });
        setShow(true);
    };

    const handleNavigation = (title) => {
        if (title === 'Whitelist') {
            navigate('./PageComponent'); // Naviger til sidekomponenten for whitelist
        } else if (title === 'Contact') {
            navigate('./Contact'); // Naviger til kontaktsiden
        } else {
            handleShow(title, 'Some information about ' + title); // Åpner modal for andre elementer
        }
    };

    return (
        <div className='MenuBar-Container'>
            <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
                <div className="container">
                    <div className="row">
                        {['Whitelist', 'LearnReflect AI - GPT Assistant', 'AI Audio Enhancer', 'AI Video Enhancer', 'Contact'].map((title, index) => (
                            <div className="col-12 mb-3" key={index}>
                                <span
                                    onClick={() => handleNavigation(title)}
                                    className="title-span">
                                    {title}
                                </span>
                            </div>
                        ))}
                    </div>
                </div>
            </nav>

            {/* Modal for displaying information */}
            <Modal show={show} onHide={handleClose}>
                <Modal.Header closeButton>
                    <Modal.Title>{modalContent.title}</Modal.Title>
                </Modal.Header>
                <Modal.Body>{modalContent.action}</Modal.Body>
                <Modal.Footer>
                    <Button variant="secondary" onClick={handleClose}>
                        Close
                    </Button>
                </Modal.Footer>
            </Modal>
        </div>
    );
}
